import React from 'react';
import { Map, Marker, TileLayer,Popup } from 'react-leaflet';
import "../css_comps/atlas.css"



function AppMap(props){
    let item =props.item;

  return(
    // <div className="mt-2 border border-danger">
      <Map className="bg-success" center={[item.latlng[0], item.latlng[1]]} zoom={4}>
            <TileLayer className="mr-0"
              url='https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png'
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
            />
            <Marker
              position={[item.latlng[0], item.latlng[1]]}
            />
          </Map>
    // </div> 
  )
}

export default AppMap
